      <div className='my-3'>
          <div className="card">
                <img src={!imgUrl? "https://www.google.com/search?q=technology+pic&sxsrf=APq-WBsQpO_cAf73FGzLhst0jUI8_JGKqw:1646810313417&tbm=isch&source=iu&ictx=1&vet=1&fir=-onQKDyAXwRIJM%252C0cIuuvIh6u3mtM%252C_%253BzGxvu4H8OcIa6M%252C0cIuuvIh6u3mtM%252C_%253BBlqBvJkQdpJpZM%252CbYet3ye585cVdM%252C_%253B_Oi6WvezMbmBuM%252CMSRXFgcBweyh3M%252C_%253BJxCUdXerg9dGGM%252COJrNHdI_IjEEiM%252C_%253B7ebcNRE_B78mUM%252C2rTu5dlyhlNqcM%252C_%253Brpijp9EHQLOdiM%252CbYet3ye585cVdM%252C_%253BSyWt1iHSssN04M%252CMuVUdz2ocOQq3M%252C_%253B1hZ2w2_K3_wR4M%252CqgyLA4Wft8sSWM%252C_%253Bwkllw5q8mZilrM%252C30PmN8hlC5L7gM%252C_%253B9KxnAmBKw-IxBM%252C0cIuuvIh6u3mtM%252C_%253BdzPmLRI3bxLtOM%252CfYVRpDcKga-bhM%252C_&usg=AI4_-kTmQkYKoJI6RzUwtwSzqrJtUfaXsg&sa=X&ved=2ahUKEwi69vi9vrj2AhXcwAIHHS5bDb0Q9QF6BAgVEAE#imgrc=zGxvu4H8OcIa6M" : ""} className="card-img-top" alt="..." />
                <div className="card-body">
